import Button from "../common/Button";
import styled from "styled-components";
const PostManagementBlock =styled.div`
display: flex;
flex-direction:row;
margin-left: auto;
padding:2rem;
`

const PostManagement = ()=>{

    return(
      <PostManagementBlock>
      <Button gray>수정</Button>
      <Button gray>삭제</Button>
      <Button green>뒤로가기</Button>
      </PostManagementBlock>
    )
  }
export default PostManagement;
